import React, {Component} from 'react';
import ReactPlayer from 'react-player';

export class ExibeVideo extends Component {
    render() {
        return (
            <div className='CorpoCVM'>
                <section className="portfolio-block projects compact-grid">
                <div className="heading">
                    <h1>Seu Video est√° pronto!!!${this.props.match.params.id}</h1>
                </div>

                <ReactPlayer url={`https://vimeo.com/${this.props.match.params.id}`} playing width='100%' />

                </section>
            </div>
        )
    }
}
export default ExibeVideo;
